# Given two DNA strands, s and t
# Return the 'Hamming distance', the number of bp that are different between s and t

# eg) Given
# s = GAGCCTACTAACGGGAT
# t = CATCGTAATGACGGCCT
#     ^ ^ ^  ^ ^    ^^
# Hamming dist = 7

s = ""
t = ""


def hamming_dist(s_str, t_str):
  count = 0
  for i in range(0, len(s) - 1):
    if s[i] != t[i]:
      count += 1

  return count


print(hamming_dist(s, t))
